import React from 'react'

class GalleryItem extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            element: [JSON.parse(JSON.stringify(this.props.element))]
        }
        this.state.element.key = 1
    }
    componentDidMount() {
    }
    render() {
        return (
            this.state.element
        )
    }
}

export default GalleryItem;
